import React from 'react';
import { View, Text, StyleSheet, Image, TouchableOpacity } from 'react-native';
import Icon from 'react-native-vector-icons/FontAwesome'; // Asegúrate de instalar esta biblioteca

const Navbar = () => {
  return (
    <View style={[styles.navbar, styles.navbarWithMargin]}>
      <TouchableOpacity style={styles.menuIcon}>
        <Icon name="bars" size={30} color="white" />
      </TouchableOpacity>
      <View style={styles.titleContainer}>
        <Image
          source={require('../assets/img/GIcon.png')}
          style={styles.logo}
          resizeMode="contain"
        />
        <Text style={styles.navbarText}>Tuiranfit</Text>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  navbar: {
    backgroundColor: 'black',
    flexDirection: 'row',
    padding: 10,
    alignItems: 'center',
    justifyContent: 'space-between', // Alinear los elementos a lo largo del eje principal
    borderRadius: 10,
  },
  navbarWithMargin: {
    marginBottom: 10,
  },
  menuIcon: {
    marginLeft: 10, // Agregado para espaciar el ícono de menú del lado izquierdo
  },
  titleContainer: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  logo: {
    width: 30,
    height: 30,
    marginRight: 10,
  },
  navbarText: {
    color: 'white',
    fontSize: 20,
    fontWeight: 'bold',
  },
});

export default Navbar;
